  [],\n\t\"revision_timestamp\": \"2016-08-04T08:17:56.237279\",\n\t\"name\": \"becharof-national-wildlife-refuge-annual-narrative-report-calendar-year-1986\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Becharof
  NWR outlines Refuge accomplishments during the 1986 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the master plan,
  management planning, compliance with environmental and cultural resource mandates,
  and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, volunteer programs, funding, and safety is given.
  Habitat management is also covered; subjects include wetlands, fire management,
  water rights, and wilderness areas. The wildlife section of the report discusses
  wildlife diversity, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, marine mammals, scientific collections, and marking and bird banding.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, hunting, fishing, trapping, wildlife observation, outdoor
  recreation, and law enforcement. The equipment and facilities section of the report
  provides information about new construction, rehabilitation, major maintenance,
  computer systems, and energy conservation. Cooperative programs, economic uses of
  the Refuge, and items of interest are provided at the end.\",\n\t\"license_title\":
